import React from "react";
import Header from "../layouts/Header";

const HomePage = () => {

    const getProducts = async () => {

        const response = await fetch('http://localhost:5000/api/products');
        await response.json();
    }

    getProducts();
    return (
        <>
            <Header/>
            <main className="p-8">
                <h1 className="text-3xl mt-4 mb-3">Our Products</h1>
                <div className="w-56 border-[1px] border-gray-300 p-3 rounded-xl shadow-lg">
                    <img src="https://fdn2.gsmarena.com/vv/pics/apple/apple-iphone-15-pro-1.jpg" alt="Iphone 15 Pro" />

                    <div className="text-sm text-blue-800 mt-3">Iphone 15 Pro</div>
                    <div className="font-semibold text-sm">Rp. 12.000.000</div>
                    <div className="flex items-center mt-3 justify-end">
                        <button className="bg-blue-800 text-white py-1 px-2 rounded text-sm">
                            <span className="material-symbols-outlined text-sm">
                                shopping_cart
                            </span>
                            Add to cart</button>
                    </div>
                </div>
            </main>
        </>
    )
}

export default HomePage;
